        bg-red-100	background-color: rgb(254 226 226);
        bg-red-200	background-color: rgb(254 202 202);
        bg-red-300">
        <Link to={"/signup"}>Гарах</Link>
      </button>
      }
        
      </div>
    </React.Fragment>
  );
}

export default Header;
